import React from 'react';
import '../index.scss';

const Order = () => {
  return (
    <section className="content">
      <h1>Мои покупки</h1>
      <div className="cards">
        <div className="card">
          <img src="/img/sneakers/sneak1.png" alt="" />
          <div className="cardofitems">
            <div className="card-name">
              <p className="name-line">Nike dunk Hi Retro</p>
              <p className="price-line">11999 p.</p>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Order;
